        </Col>
        <Col>
          <FitTextToCell>
            <Input
              label="Days"
              placeholder="Days"
              text={respiratory.caughDays}
              setText={(text) => {
                setRespiratory({ caughDays: text });
              }}
            />
          </FitTextToCell>
        </Col>

        <Col cols={3.3}>
          <Row>
            <SimpleQuestion
              options={['Wet', 'Dry']}
              checked={respiratory.caughNature}
              setChecked={(text) => {
                setRespiratory({ caughNature: text });
              }}
            />
          </Row>
          <Spacer size={4} />
          <Text>If productive, what is sputum color:</Text>
