            <SimpleQuestion
              options={['Red', 'green', 'white', 'clear']}
              checked={respiratory.caughSpatum}
              setChecked={(text) => {
                setRespiratory({ caughSpatum: text });
              }}
            />
          </Row>
          <Spacer size={4} />
          <Text>Time </Text>
